export default {
  changeToDu: function changeToDu(du) {
    var arr1 = String(du).split(".");
    var d = arr1[0];
    var tp = "0." + arr1[1];
    tp = String(tp * 60); //这里进行了强制类型转换

    var arr2 = tp.split(".");
    var f = arr2[0];
    tp = "0." + arr2[1];
    tp = tp * 60;
    var m = parseInt(tp);
    var dfm = d + "°" + f + "'" + m;
    return dfm;
  },
  changeToDFM: function changeToDFM(dfm) {
    var arr1 = dfm.split('°');
    var d = arr1[0];
    var arr2 = arr1[1].split("'");
    var f = arr2[0] || 0;
    var m = arr2[1] || 0;
    f = parseFloat(f) + parseFloat(m / 60);
    var du = parseFloat(f / 60) + parseFloat(d);
    return String(du);
  }
};
